import React, { Component } from "react";
import "../css/ToDoList.css";

class ToDoList extends Component<Props> {
  constructor() {
    super();
    this.state = {
      list_items: []
    };
  }

  populateList = cur_item => {
    let new_arr = this.state.list_items;
    new_arr.push(
      <div>
        <text>{cur_item}</text>
      </div>
    );
    this.setState({
      list_items: new_arr
    });
  };

  render() {
    return (
      <div className="to-do-list-container">
        <input />
        <button>submit</button>
        <div>
          <text>item1</text>
          {this.populateList()}
        </div>
      </div>
    );
  }
}

export default ToDoList;
